        return $term->parent === $brand->term_id;
    });
    $brands = wp_list_pluck($brands, 'name');
    $terms = wp_list_pluck($terms, 'name');
    $values = array_unique(array_merge($brands, $terms));
    return !empty($values)
        ? sprintf(__('Review of %s', 'site-reviews'), \GeminiLabs\SiteReviews\Helpers\Str::naturalJoin($values))
        : '';
}, 10, 2);

