inline void solve() {
    int n;
    cin >> n;
    vector<int> a(n);
    for (int i = 0; i < n; ++i) {
        cin >> a[i];
    }
    set<pair<int, int>> st;
    map<int, int> used, min_color;
    vector<int> ans(n);
    st.insert({a[0], 1});
    ans[0] = 1;
    used[1] = a[0];
    min_color[a[0]] = 1;
    int max_color = 1;
    for (int i = 1; i < n; ++i) {
        auto it = st.lower_bound({a[i], 0});
        if (it == st.end()) {
            st.erase({used[1], 1});
            st.insert({a[i], 1});
            ans[i] = 1;
            min_color[a[i]] = 1;
            continue;
        }
        while (it != st.begin() && it->first >= a[i] && it->second > (--it)->second) {
            --it;
        }
        if (it->first >= a[i]) {
            st.insert({a[i], ++max_color});
            ans[i] = max_color;
            min_color[a[i]] = 1;
        } else {
            int x = it->first;
            int col = it->second;
            cout << x << ' ' << col << endl;
            st.erase(it);
            st.insert({a[i], col});
            ans[i] = col;
        }
    }
    cout << max_color << '\n';
    for (auto i: ans) {
        cout << i << ' ';
    }
    cout << '\n';
}


